void resolver_cpu(TabloideGPUs &tabloide) {
	TSimplexGPUs simplex = desestructurarTabloide(tabloide);
	
	printStatus(simplex);
	
	moverseASolFactible(simplex);
	
	agregarRestriccionesCotaSup(simplex);
	
	agregarVariablesHolguraArtificiales(simplex);
	
	resolverZj_Cj_ph1(simplex);
	
	printf("After resolverZj_Cj_ph1\n");
	printStatus(simplex);
	
	resolver_simplex_phase_one(simplex);
	
	resolverZj_Cj_ph2(simplex);
	
	resolver_simplex_phase_two(simplex);
	
	printf("Final");
	printStatus(simplex);
	printResult(simplex);
	
}

TSimplexGPUs desestructurarTabloide(TabloideGPUs &tabloide) {
	TSimplexGPUs smp;
	
	smp.tabloide = tabloide;
	
	smp.var_x = (int) tabloide[0];
	smp.rest_ini = (int) tabloide[1];
	smp.mat_adv_row = (int) tabloide[2];
	smp.var_all = (int) tabloide[smp.mat_adv_row];
	smp.rest_fin = (int) tabloide[smp.mat_adv_row + 1];
	
	smp.z = &tabloide[4]; // funcion z, cantidad de variables, horizontal, primera fila
	smp.zZ = &tabloide[3]; // funcion z con resultado, cantidad de variables + 1, horizontal, primera fila
	
	smp.z_ph1 = &tabloide[5*smp.mat_adv_row + 4]; // largo filas, horizontal, sexta fila
	smp.zZ_ph1 = &tabloide[5*smp.mat_adv_row + 3]; // largo filas, horizontal, sexta fila
	
    smp.flg_x = &tabloide[smp.mat_adv_row + 4]; // cantidad de variables, horixontal, segunda fila 
	
	smp.sup = &tabloide[2*smp.mat_adv_row + 4]; // cantidad de variables, horizontal, tercera fila
	smp.inf = &tabloide[3*smp.mat_adv_row + 4]; // cantidad de variables, horizontal, cuarta fila
	
	smp.var_type = &tabloide[4*smp.mat_adv_row + 4]; // largo filas, 0 = var x, 1 = var s y 2 = var a, horizontal, quinta fila
	
	//smp.top = &tabloide[5*smp.mat_adv_row + 4]; // largo filas, horizontal, sexta fila
    smp.left = &tabloide[6*smp.mat_adv_row]; // largo restricciones finales, vertical, primera columna
	
	smp.flg_y = &tabloide[6*smp.mat_adv_row + 1]; // 0 restriccion >=, 1 <=, 2 =, vertical, segunda columna
	
	smp.Cb = &tabloide[6*smp.mat_adv_row + 2]; // cantidad de restricciones, vertical, tercera columna
	smp.Xb = &tabloide[6*smp.mat_adv_row + 3]; // cantidad de restricciones, vertical, cuarta columna
	
    smp.matriz = &tabloide[6*smp.mat_adv_row + 4];
	smp.mat_ext = smp.Xb; // El vector Xb esta contiguo a la matriz por lo tanto su direccion es igual a la matriz extendida Xb|A
	
	return smp;
}

void moverseASolFactible(TSimplexGPUs &smp) {
	for (int i = 0; i < smp.rest_ini; i++) {
		if (smp.Xb[i*smp.mat_adv_row] < 0) {
			smp.Xb[i*smp.mat_adv_row] *= -1;
			for (int j = 0; j < smp.var_x; j++) {
				smp.matriz[i*smp.mat_adv_row + j] *= -1;
			}
			smp.flg_y[i*smp.mat_adv_row] = (smp.flg_y[i*smp.mat_adv_row] == 0) ? 1 : 2; // Move >= to <=
		}
	}
}

void agregarRestriccionesCotaSup(TSimplexGPUs &smp) {
	int qrest = smp.rest_ini;
	for (int i = 0; i < smp.var_x; i++) {
		//printf("agRCSup i %i\t", i);
		if (smp.flg_x[i] > 0) {
			//printf("M %i\n", (smp.rest_ini + i)*smp.mat_adv_row);
			smp.flg_y[(smp.rest_ini + i)*smp.mat_adv_row] = 1;
			//printf("N ");
			smp.Xb[(smp.rest_ini + i)*smp.mat_adv_row] = smp.sup[i];
			//printf("O ");
			for (int j = 0; j < smp.var_x; j++) {
				smp.matriz[qrest*smp.mat_adv_row + j] = (qrest == (j + smp.rest_ini))? 1 : 0;
				//printf("agRCSup j %i, qrest %i\t", j, qrest);
			}
			qrest ++;
		}
	}
	// printf("Rest count %i / %i \n", smp.rest_fin, qrest);
	if (smp.rest_fin != qrest) printf("DISCREPANCIA EN LA CANTIDAD DE RESTRICCIONES FINAL\n");
}

void agregarVariablesHolguraArtificiales(TSimplexGPUs &smp) {
	int var_s, var_a, var_count;
	var_s = 0; var_a = 0; var_count = smp.var_x;
	
	for (int i = 0; i < smp.var_x; i++) {
		smp.var_type[i] = 0;
	}
	
	// Completo con 0s la matriz
	for (int i = 0; i < smp.rest_fin; i++) {
		for (int j = var_count; j < smp.var_all; j++) {
			smp.matriz[i*smp.mat_adv_row + j] = 0;
		}
	}
	
	for (int i = 0; i < smp.rest_fin; i++) {
		if (smp.flg_y[i*smp.mat_adv_row] == 0) { // rest >=
			smp.matriz[i*smp.mat_adv_row + var_count] = -1;
			smp.matriz[i*smp.mat_adv_row + var_count +1] = 1;
			
			smp.var_type[var_count] = 1;
			smp.var_type[var_count + 1] = 2;
			
			smp.z[var_count] = 0;
			smp.z[var_count + 1] = 0;
			
			smp.left[i*smp.mat_adv_row] = var_count + 1;
			
			smp.Cb[i*smp.mat_adv_row] = 1;
			
			var_s++; var_a++; var_count += 2;
		} else if (smp.flg_y[i*smp.mat_adv_row] == 1) { // rest <=
			smp.matriz[i*smp.mat_adv_row + var_count] = 1;
			
			smp.var_type[var_count] = 1;
			
			smp.z[var_count] = 0;
			
			smp.left[i*smp.mat_adv_row] = var_count;
			
			smp.Cb[i*smp.mat_adv_row] = 0;
			
			var_a++; var_count ++;
		} else { // 2: rest =
			smp.matriz[i*smp.mat_adv_row + var_count] = 1;
			
			smp.var_type[var_count] = 2;
			
			smp.z[var_count] = 0;
			
			smp.left[i*smp.mat_adv_row] = var_count;
			
			smp.Cb[i*smp.mat_adv_row] = 1;
			
			var_s++; var_count ++;
		}
	}
	
	printf("Var count %i / %i \n", smp.var_all, var_count);
	if (smp.var_all != var_count) printf("DISCREPANCIA EN LA CANTIDAD DE VARIABLES FINAL\n");
	
}

// min z = A1 +...+ An 
void resolver_simplex_phase_one(TSimplexGPUs &simplex) {
	int zpos, qpos, it;
	
	it = 0;
	
	do {
		zpos = locate_mejor_dj_ph(simplex, simplex.z_ph1);
		
		if (zpos < 0) {
			printf("%s %i\n", "Condicion de parada maximo encontrado en iteracion", it);
			return;
		}
		
		qpos = locate_min_ratio(simplex, zpos);
		if (qpos < 0) {
			printf("%s %i\n", "Posicion de cociente no encontrada en iteracion", it);
			return;
		}
		
		intercambiarvars_ph(simplex, qpos, zpos, simplex.zZ_ph1);
		
		it++;
		
		if (it == 128) {
			printf("Max %i iterations achieved\n", it);
			return;
		}
	} while (true);
	
}


void resolverZj_Cj_ph1(TSimplexGPUs &smp) {
	double ci;
	
	for (unsigned int i = 0; i < smp.rest_fin; i++) {
		ci = smp.Cb[i*smp.mat_adv_row];
		if (ci != 0) {
			smp.zZ_ph1[0] += smp.Xb[i*smp.mat_adv_row]; 
			for (unsigned int j = 0; j < smp.var_all; j++) {
				if (smp.var_type[j] != 2){
					smp.z_ph1[j] += smp.matriz[i*smp.mat_adv_row + j];
				}
			}
		}
	}
}

void resolverZj_Cj_ph2(TSimplexGPUs &smp) {
	double ci;
	
	for (unsigned int i = 0; i < smp.rest_fin; i++) {
		ci = smp.Cb[i*smp.mat_adv_row];
		if (ci != 0) {
			smp.zZ[0] += ci*smp.Xb[i*smp.mat_adv_row]; 
				
			for (unsigned int j = 0; j < smp.var_all; j++) {
				if (smp.var_type[j] != 2){
					smp.z[j] += ci*smp.matriz[i*smp.mat_adv_row + j];
				}
			}
		}
	}
}

void resolver_simplex_phase_two(TSimplexGPUs &simplex) {
	int zpos, qpos, it;

	it = 0;
	
	do {
		zpos = locate_mejor_dj_ph(simplex, simplex.z);
		
		if (zpos < 0) {
			printf("%s %i\n", "Condicion de parada maximo encontrado en iteracion", it);
			return;
		}
		
		qpos = locate_min_ratio(simplex, zpos);
		if (qpos < 0) {
			printf("%s %i\n", "Posicion de cociente no encontrada en iteracion", it);
			return;
		}
		
		intercambiarvars_ph(simplex, qpos, zpos, simplex.zZ);
		
		it++;
		
		if (it == 128) {
			printf("Max %i iterations achieved\n", it);
			return;
		}
	} while (true);
	
}

int locate_mejor_dj_ph(TSimplexGPUs &smp, double * zph) {
	int mejorz, z;
	double max_apz, apz;
	
	mejorz = -1;
	max_apz = 0;
	for (z = 0; z < smp.var_all; z++) {
		if (smp.var_type[z] != 2) { // If it is not an artificial variable
			apz = zph[z];
			if (apz > 0 && apz > max_apz) {
				mejorz = z;
				max_apz = apz;
			}
		}
	}
	
	return mejorz;
}


int locate_min_ratio(TSimplexGPUs &smp, int zpos) {
	int mejory, y;
	double min_apy, qy, denom;

	mejory = -1;
	min_apy = MaxNReal;
	for (y = 0; y < smp.rest_fin; y++) {
		denom = smp.matriz[y*smp.mat_adv_row + zpos];
		if (denom > CasiCero_Simplex) {
			qy = smp.Xb[y*smp.mat_adv_row] / denom;
			if (qy > CasiCero_Simplex && qy < min_apy) {
				mejory = y;
				min_apy = qy;
			}
		}
	}
	return mejory;
}

bool intercambiarvars_ph(TSimplexGPUs &smp, int kfil, int jcol, double * zZph) {

	double m, invPiv;
	int i, j, ipos;
	
	invPiv = 1 / smp.matriz[kfil * smp.mat_adv_row + jcol];
	
	ipos = kfil * smp.mat_adv_row;
	smp.Xb[kfil*smp.mat_adv_row] *= invPiv; // Modifico Xb
	for (j = 0; j < smp.var_all; j++) { // Modifico la k fila
		smp.matriz[ipos + j] *= invPiv;
	}
	smp.matriz[ipos + jcol] = 1;
	
	for (i = 0; i < smp.rest_fin; i++) {
		if (i != kfil) {
			m = smp.matriz[i*smp.mat_adv_row + jcol];
			
			smp.Xb[i*smp.mat_adv_row] -= m*smp.Xb[ipos]; // Modifico Xb
			for (j = 0; j < smp.var_all; j++) { // Modifico la Matriz
				if (j != jcol) {
					smp.matriz[i*smp.mat_adv_row + j] -= m * smp.matriz[ipos + j]; 
				} else {
					smp.matriz[i*smp.mat_adv_row + j] = 0;
				}
			}
		}
	}
	
	// Actualizo la funcion z o z*
	m = zZph[jcol + 1];
	for (unsigned int x = 0; x <= smp.var_all; x ++){
		if ((x - 1) != jcol) {
			zZph[x] -= smp.mat_ext[ipos + x]*m;
		} else {
			zZph[x] = 0;
		}
	}
	
	smp.left[ipos] = jcol;
	smp.Cb[ipos] = -smp.z[jcol];
	
	return true;
 }


